          <div className="h-full w-full bg-red-500">

          </div>
        </div>
        <p className="block text-xl font-bold text-gray-100 truncate pointer-events-none">Podcast title</p>
        <p className="block text-sm font-medium text-gray-500 pointer-events-none">Publisher</p>
      </li>
    </ul>    
  );
}
